import React, { useContext, useEffect } from "react";
import { AnimeContexte } from "../contexte/AnimeContexte";

const Home = () => {
  const { fetchAnime, animes } = useContext(AnimeContexte);
  useEffect(() => {
    fetchAnime();
  }, []);

  return (
    <div>
      {animes.map((anime) => (
        <p key={anime.id}>{anime.attributes.titles.en}</p>
      ))}
    </div>
  );
};

export default Home;
